import React from 'react';
import '../../App.css';

export default function Services() {
  return (
  <>
  <section className = "test">
  <h1 className='services'>SERVICES</h1>
  <video src='/videos/video-1.mp4' autoPlay loop muted />
  </section>
  
  
<div className = "Installation">
{/* <image src= '/images/servicesimage.jpg'/> */}

  <img className='mulch' src='/images/mulchinsta.jpg' alt="Mulch Picture"></img>
  <div className = "Information text-center">
    <h1 >Arnprior Earth Depot is proud to partner with our trusted peers at Capital Asphalt & Interlock to offer installation services to our clientele. </h1>
  </div>

</div>
  
  </>
  );
}
